                    <section class="about__section">
                        <h1 class="h2_green">Evolet</h1>
                        <p class="text">
                            Название «Evolet» от скандинавского - «обещание жизни». Именно это название лучше всего
                            характеризует нашу компанию. Ведь это обещание наша фактическая ответственность, которую Мы
                            берем перед будущим этого Мира и перед Вами.
                        </p>
                        <p class="text">
                            C момента основания, первостепенной задачей компании была забота о здоровье людей,
                            населяющих Мир.
                        </p>
                        <p class="text">
                            Мы вносим свой вклад в улучшение качества жизни и здоровья людей во всем мире, сохраняя
                            приверженность высоким стандартам этики и ответственности перед партнёрами и обществом.
                        </p>
                    </section>
                    <section class="about__section">
                        <h2 class="h2_green">Мировое присутствие</h2>
