                            <div class="text">
                                <a href="index.html#" data-fancybox="news" data-src="#news-0" href="javascript:;"
                                    class="link">«Дорожная карта» (HealthNet) будет реализована в три этапа.</a>
                            </div>
                            <div style="display: none;" id="news-0">
                                <h2>«Дорожная карта» (HealthNet) будет реализована в три этапа.</h2>
                                <p>20 декабря в Первом МГМУ им. И.М. Сеченова состоялось заседание президиума совета по
                                    модернизации экономики и инновационному развитию во главе с премьер-министром
                                    Дмитрием Медведевым. На заседании была одобрена дорожная карта HealthNet
                                    Национальной технологической инициативы (НТИ) по развитию рынка биотехнологических и
                                    медицинских продуктов и услуг.<br>
                                    <br>
                                    Рассказывая о дорожной карте, со-руководитель рабочей группы HealthNet - А.Репик
                                    отметил, что HealthNet – один из самых важных и быстрорастущих рынков в мире, и что
                                    первоочередной задачей сегодня является формирование необходимых условий и
                                    инфраструктуры для его развития в России.<br>
                                    «Дорожная карта» будет реализована в три этапа.

                                    Первый этап (2017–2019 годы) – создание необходимой инфраструктуры развития малых
                                    компаний рынка «Хелснет». Малые компании должны обеспечить поток высокотехнологичных
                                    разработок и решений.

                                    Второй этап (2020–2025 годы) – создание и развитие инфраструктуры для поддержки
                                    средних компаний рынка «Хелснет»: обновление нормативно-правовой базы в связи с
                                    появлением новых технологий и новых подходов, выявленных на первом этапе; реализация
                                    концепции изменения образования, включение государственных институтов международного
                                    сотрудничества для поддержки выхода компаний «Хелснет» на международные рынки;
                                    реализация среднесрочных рыночных проектов по созданию благоприятной среды для
                                    компаний, выявленных как приоритетные на первом этапе.

                                    Третий этап (2026–2035 годы) – реализация долгосрочных проектов, включающая
                                    тиражирование технологических решений посредством развития компаний, и полноценный
                                    запуск проектов, пилотные стадии которых были реализованы на первом и втором этапах.

                                    <br>
                                    «Объём рынка HealthNet в составе мирового рынка здравоохранения уже почти триллион
                                    долларов. Причём по самым скромным оценкам экспертов к 2035 году он превысит 9 трлн
                                    в ближайшие 20 лет в здравоохранении мы станем свидетелями изменений, из-за которых
                                    многие инвесторы называют рынок Хелснета “новым IT направлением”. <br>
                                    Действительно, по значимости они не уступят появлению Интернета, мобильных
                                    устройств, социальных сетей»<br>
                                    <br>
                                    Первый замминистра здравоохранения, соруководитель рабочей группы HealthNet
                                    рассказал, что в основу «дорожной карты» легли шесть наиболее перспективных
                                    направлений: <strong>информационные технологии в медицине, медицинская генетика,
                                        биомедицина, спорт и здоровье, превентивная медицина, здоровое долголетие.
                                    </strong><br>
                                    «В рамках дорожной карты предусмотрены реализация пилотных проектов в сферах
                                    регенеративной медицины, микробиологии, инвазивных технологий, кардиологии,
                                    иммунологии, педиатрии, неврологии, онкологии и в других приоритетных направлениях;
                                    формирование регуляторного поля для внедрения новых технологий; развитие
                                    профессионального образования, совершенствование образовательных программ и создание
                                    образовательных модулей для обеспечения кадрами развивающихся новых направлений
                                    биомедицины.<br>
                                    <br>
                                    Проект дорожной карты предусматривает комплексный анализ законодательства России,
                                    направленного на совершенствование регулирования рынка инновационных лекарственных
                                    препаратов, регулирование применения телемедицинских и информационных технологий,
                                    обращение и использование биоискусственных органов, тканей и систем, внедрение
                                    генетической диагностики нового поколения.<br>
                                    <br>
                                    <strong>Главные направления работы в рамках HealthNet</strong>: развитие методик
                                    редактирования генома, как например, CRISPR\CAS9, развитие оптогенетики,
                                    телемедицины, появление новых систем адресной доставки лекарств (например,
                                    наноботы), применение методов виртуальной и дополненной реальности в терапии и
                                    медицинском образовании, развитие технологии “Орган-на-чипе” (использование
                                    микрочипов в качестве моделей органов или целого организма для проведения
                                    клинических испытаний лекарственных препаратов), производство лекарственных
                                    препаратов с помощью микрофлюидных чипов размером с ладонь (Point-of-care),
                                    роботизация в медицине, 3D-печать органов, создание биофабрик (выращивание органов
                                    из собственных и животных клеток), биометрические датчики, измеряющие все важные
                                    параметры здоровья человека 24/7 и фиксирующие опасные отклонения от нормы и пр.<br>
                                    <br>
                                </p>
                            </div>
                        </div>
                    </div>



