                                    интеллект в Фарме»</a>
                            </div>
                            <div style="display: none;" id="news-1">
                                <h2>Прошла 3-я ежегодная конференция «Большие данные и искусственный интеллект в Фарме»
                                </h2>
                                <p>7 декабря, 2018. в Москве прошла 3-я ежегодная конференция «Большие данные и
                                    искусственный интеллект в Фарме»

                                    Ключевая тема 2018 года – Пациентоцентричность
                                    Сегодня в мировой фармацевтической и биотех-индустрии все более значимой становится
                                    роль пациента и генерируемых им медицинских и иных данных. Эти данные используются
                                    для разработки новых лекарств, для лучшего понимания пути пациента, более точного
                                    сегментирования пациентской аудитории и для подбора персонализированного лечения.

                                    Навстречу этому мощному тренду идут высокие технологии, связанные с интернетом,
                                    искусственным интеллектом и большими данными. Они позволяют получать знания из
                                    реального мира, на огромных выборках, при этом обеспечивать максимально
                                    индивидуализированный подход и учитывать все аспекты.


                                    Международные производители признают, что сегодня недостаточно эффективно идет
                                    коммерциализация разрабатываемых препаратов. Производители считают, что снижать
                                    затраты и создавать препараты для орфанных заболеваний помогут Большие данные (Big
                                    Data). Об этом заявили на проходящей 7 декабря конференции «Большие данные и
                                    искусственный интеллект в фарме» топ-менеджеры «Р-Фарм», «АстраЗенека» (AstraZeneca)
                                    и Novartis.<br>
                                    <br>
                                    При росте стоимости клинических исследований с 1 до 2,5 млрд долл. падает доля
                                    успешного вывода молекул на рынок.<br>
                                    <br>
                                    «Парадокс – чем больше молекул в портфеле компании, тем ниже показатель успешного
                                    вывода на рынок», – говорит директор по научной работе Novartis.
                                    Не панацею, но шанс видят компании в использовании Больших данных для повышения
                                    эффективности сбора данных и снижения затрат.<br>
                                    Директор медицинского департамента «Р-Фарм» отметил, что во второй половине 2018 г.
                                    резко возрос интерес фармы к Большим данным: «Уже сегодня есть кейсы успешного
                                    взаимодействия крупнейших мировых фармкомпаний с ИТ-компаниями по сбору и анализу
                                    данных. И можно утверждать, что цифровая инфраструктура в клинических исследованиях
                                    – это уже не космос, а реальность». <br>
                                    Директор Semantic Hub привела интересные данные, демонстрирующие динамику
                                    проникновения цифры в отрасли. Если ИТ-технологии заходили в авиацию 68 лет, то в
                                    последние годы цифровые инструменты охватили соцсеть Фейсбук за три года.
                                    Безусловно, клинические исследования ближе по циклу вывода продукта к авиации, но
                                    эффект сингулярности позволит сокращать эти сроки. <br>
                                    Также отметили что работа с данными позволяет детально работать с конечным
                                    потребителем, понимая его запросы, потребности в использовании препарата. Эти
                                    маркетинговые данные, собираемые из различных источников при помощи программных
                                    решений, не только снижают затраты, но и дают более детальную информацию. В
                                    частности, удается узнать, за сколько дней до окончания упаковки лекарств пациент
                                    идет в аптеку за покупкой следующей упаковки.<br>
                                    <br>

                                    Источник: https://pharmvestnik.ru/
                                </p>
