                            </div>
                            <div style="display: none;" id="news-2">
                                <h2>Мнение эксперта: основная угроза отечественному фарм-рынку РФ </h2>
                                <p><img
                                        src="https://pharmvestnik.ru/apps/fv/assets/cache/files/content/news/639/63908/front-jpg/front-z-700.jpg?time=1541752998"><br>
                                    <br>
                                    &nbsp;Захар Голант (в центре) | Фото: pharmvestnik.ru<br>
                                    <br>
                                    Федеральные регуляторные органы за последние четыре года приняли все необходимые для
                                    успешного развития фармотрасли нормативные документы, которые полностью
                                    гармонизированы с международным законодательством. Так считает председатель
                                    правления Союза «Медико-фармацевтические проекты. XXI век» Захар Голант.<br>
                                    <br>
                                    «Основная угроза для фармрынка, да и для любого рынка вообще – это неправильное
                                    ценообразование, когда власти могут, не дай бог, скатиться в популизм. Новые попытки
                                    изменить ценообразование, безусловно, несут огромные риски», – сказал эксперт на
                                    пресс-конференции, прошедшей в медиацентре правительства Санкт-Петербурга.<br>
                                    <br>
                                    Методика ограничения цен на лекарственные препараты, входящие в перечень ЖНВЛП,
                                    принятая в 2010 году, привела к крайне неоднозначным эффектам, считает Захар Голант.
                                    Сегодня российские&nbsp;фармпредприятия&nbsp;могут&nbsp;развиваться очень успешно,
                                    но как только принимается новая методика ценообразования, которая ничего не
                                    позволяет сделать с уже зарегистрированной ценой на выпускаемый препарат,
                                    производителю подчас приходится выпуск продукции просто останавливать.<br>
                                    <br>
                                    «Так произошло, в частности, с вымыванием с рынка относительно дешевой продукции,
                                    которая стала в итоге недоступной для потребителя», – подчеркнул эксперт.<br>
                                    <br>
                                    Популистские шаги, направленные якобы на снижение цен, делают невозможным возврат
                                    инвестиций ни в разработку новых препаратов, ни в строительство новых производств,
                                    убежден эксперт. В качестве яркого примера г-н Голант привел Турцию, где еще в
                                    начале 2000-х годов очень мощно развивалась фармотрасль, но затем в результате
                                    неверной ценовой политики рынок был «открыт всем ветрам», и в принятой системе
                                    ценообразования с тенденцией на удешевление лекарств фарме стало, по сути,
                                    невозможно существовать.<br>
                                    <br>
                                    И вторая острая проблема отечественной фармотрасли – интеллектуальная собственность:
                                    неправильное регулирование в этой области тоже чревато огромными последствиями.<br>
                                    <br>
                                    «Хорошо, что сейчас активно создается судебная практика по защите патентной
                                    собственности на уровне Верховного суда, – отметил эксперт. – Сегодня уже есть
                                    десятки прецедентных исков между компаниями в отношении вещей, связанных с патентами
                                    на ЛП. И создание профильного законодательства в этой области – тренд на ближайшие
                                    десять лет».<br>
                                    Источник:&nbsp;pharmvestnik.ru<br></p>
                            </div>
                        </div>
                    </div>



