                                <h2>Регламент по производству биомедицинских клеточных продуктов</h2>
                                <p>Для производства биомедицинских клеточных продуктов было разработано регулирование
                                    контроля лицензирования.<br>
                                    Росздравнадзор разработал проект Административного регламента для осуществления
                                    лицензионных контрольных мероприятий по производству биомедицинских продуктов
                                    (BMKP).<br>
                                    <br>
                                    <b>Административные регламенты определяют:</b><br>
                                    <br>
                                    - сроки и последовательность административных процедур, административные действия
                                    для выполнения государственных функций;<br>
                                    <br>
                                    - права и обязанности должностных лиц по осуществлению контроля;<br>
                                    <br>
                                    - права и обязанности лиц, в отношении которых осуществляется деятельность по
                                    мониторингу;<br>
                                    <br>
                                    - порядок и формы контроля за исполнением государственной функции.<br>
                                    <br>
                                    Административные регламенты описывают:<br>
                                    <br>
                                    - состав, последовательность и сроки выполнения административных процедур,
                                    требования к порядку их реализации, включая особенности административных процедур
                                    (действий) в электронной форме;<br>
                                    <br>
                                    - формы контроля за исполнением государственных функций.<br>
                                    <br>
                                    Общественная дискуссия по проекту на сайте regulation.gov.ru продлится до 22 ноября
                                    2018 года<br>
                                    <br>
                                    <br>
